import React, { useState, useEffect } from "react";
import { createRoot } from "react-dom/client";
import "./index.css";
import axios from "axios";

function CounterOnConsole() {
  let num = 6;

  function multiply() {
    num = num * 2;
    console.log(num);
  }

  function divide() {
    num = num / 2;
    console.log(num);
  }

  return (
    <div>
      <div className={"header"}>{num}</div>
      <div className={"body"}>
        <button onClick={multiply}>*</button>
      </div>
      <div className={"footer"}>
        <button onClick={divide}>-</button>
      </div>
    </div>
  );
}
function CounterOnInterface() {
  const [num, setNum] = useState(12);

  function multiply() {
    setNum()
    console.log(num);
  }

  function divide() {
    num = num / 2;
    console.log(num);
  }

  return (
    <div>
      <div className={"header"}>{num}</div>
      <div className={"body"}>
        <button onClick={multiply}>*</button>
      </div>
      <div className={"footer"}>
        <button onClick={divide}>-</button>
      </div>
    </div>
  );
}

function App() {
  const var1: string = "Нурдаулет1";
  let var2: string = "Нурдаулет2";
  async function getData() {
    try {
      const response = await axios.get("http://127.0.0.1:8000/api_data");
      console.log("data: ", response.data, new Date());
    } catch (error) {
      console.error("ошибка: ", error, new Date());
    }
  }
  return (
    // - design
    <div style={{ marginLeft: "20px" }}>
      <h1>
        {var1} {var2}
      </h1>
      <button onClick={getData}>Click me!</button>
      <hr />
      <CounterOnConsole />
    </div>
  );
}

createRoot(document.getElementById("root")!).render(
  //<React.StrictMode>
  <App />,
  //</React.StrictMode>
);

